import { Link } from "react-scroll";
import classes from "./MainNavigation.module.css";

const MainNavigation = () => {
  return (
    <nav className={classes.nav}>
      <ul>
        <li>
          <Link
            activeClass={classes.active}
            to="home"
            spy={true}
            smooth={true}
            offset={-300}
            duration={500}
            delay={0}
          >
            Home
          </Link>
        </li>
        <li>
          <Link
            activeClass={classes.active}
            to="about"
            spy={true}
            smooth={true}
            offset={-300}
            duration={500}
            delay={0}
          >
            About Me
          </Link>
        </li>
        <li>
          <Link
            activeClass={classes.active}
            to="projects"
            spy={true}
            smooth={true}
            offset={-300}
            duration={500}
            delay={0}
          >
            Recent Projects
          </Link>
        </li>
        <li>
          <Link
            activeClass={classes.active}
            to="contact"
            spy={true}
            smooth={true}
            offset={-300}
            duration={300}
            delay={0}
          >
            Contact
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default MainNavigation;
